When uploading a meal, upload its ingredients (if they don't exist) to neptune, getting the macro information from our data source(s) to do so. Why not upload macros & ingredients in bulk? It is likely we will only ever utilise a small portion of the databases we reference for macros, so populating Neptune with a load of unused data will be wasteful and pointless. For example, when discussing chicken breast, we only want standard versions like "raw", "skin on", etc, rather than specific versions like "cooked in broth". Use our ChatGPT API setup to standardise ingredient names, and match ingredients from recipes to those in the datasets. Make links between meal/ingredients and macros to specify the quantity they contain. By structuring the data as links between Meal, Ingredient and Nutrient nodes, with edge values being quantities involved, we can extract and return information in the format required by the frontend (pasted below for reference). For reference : All nutrient information for all ingredients will be standardised to "per 100g" for ease of processing. interface NeptuneIngredient { itemID: NeptuneID; macroData: Array<NeptuneMacro>;
} interface NeptuneMacro { itemID: NeptuneID; macroName: string; quantity: number; unit: string;
} // UUID of item in neptune
type NeptuneID = string;
